package com.example.car_app;public class CarDetail {    private int carNumDetail;    private String carDescDetail;    public CarDetail(int carNumDetail, String carDescDetail) {        this.carNumDetail = carNumDetail;        this.carDescDetail = carDescDetail;    }    public int getCarNumDetail() {        return carNumDetail;    }    public void setCarNumDetail(int carNumDetail) {        this.carNumDetail = carNumDetail;    }    public String getCarDescDetail() {        return carDescDetail;    }    public void setCarDescDetail(String carDescDetail) {        this.carDescDetail = carDescDetail;    }    @Override    public String toString() {        return "CarDetail{" +                "carNumDetail=" + carNumDetail +                ", carDescDetail='" + carDescDetail + '\'' +                '}';    }}